import React, { useState } from 'react'
import PropTypes from 'prop-types'

export default function Navbar(prop) {
  const [mode, setMode] = useState('Dark Mode');
  
  const [mystyle,setMystyle]=useState({
    color:'rgb(200, 195, 195)',
    backgroundColor:'rgb(21, 20, 20)'
  })
  const onhandlechange=()=>{
    if (mystyle.color==='rgb(200, 195, 195)') {
       document.body.style.color='white'
        document.body.style.backgroundColor='black'
        setMystyle({
          color:'white',
          backgroundColor:'white'
        })
        setMode('Light mode')
       
      
    }
  }
  return (
    <nav className="topic" style={mystyle} id="toipc">
      <ul className="topicinside" id="topicinside">
        <li className="nametopic" style={mystyle.color}><a href="/">Home</a></li>
        <li className="nametopic" style={mystyle.color}><a href="/">{prop.method} method</a></li>
        <li className="nametopic"style={mystyle.color} id="nametopic3"><a href="/">{prop.title}</a></li>
        <li className="nametopic"><a href="/">{prop.Array}</a></li>
        <li className="nametopic"><a href="/">Help</a></li>
        <li className="nametopic"><button type="button" onClick={onhandlechange} class="btn btn-outline-secondary">{mode}</button></li>
      </ul>
    </nav>
  )
}
Navbar.propTypes = {
  title: PropTypes.string.isRequired,
  method: PropTypes.string.isRequired,
  Array: PropTypes.string.isRequired,

}
Navbar.defaultProps = {
  method: "string method",
  title: "Texutils",
  Array: "Array method",
}
